import React, { useEffect, useState } from 'react';
import { useDispatch } from 'react-redux';
import { AppState } from '../../store/redux_store';
import { Bar, Line, Radar } from 'react-chartjs-2';
import MainLayout from '../mainlayout';
import { updateNutrition } from '../../store/redux_action';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  RadialLinearScale,
  BarElement,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  Filler
} from 'chart.js';

ChartJS.register(
  CategoryScale,
  LinearScale,
  RadialLinearScale,
  BarElement,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  Filler
);

interface ChartData {
  labels: string[];
  datasets: {
    label: string;
    data: number[];
    fill: boolean;
    backgroundColor: string;
    borderColor: string;
    pointBackgroundColor: string;
    pointBorderColor: string;
    pointHoverBackgroundColor: string;
    pointHoverBorderColor: string;
  }[];
}

const Dashboard: React.FC = () => {
  const dispatch = useDispatch();
  const [data, setData] = useState<ChartData>({
    labels: [],
    datasets: [
      {
        label: 'Calories',
        data: [],
        fill: true,
        backgroundColor: 'rgba(255, 99, 132, 0.2)',
        borderColor: 'rgb(255, 99, 132)',
        pointBackgroundColor: 'rgb(255, 99, 132)',
        pointBorderColor: '#fff',
        pointHoverBackgroundColor: '#fff',
        pointHoverBorderColor: 'rgb(255, 99, 132)'
      },
      {
        label: 'Protein',
        data: [],
        fill: true,
        backgroundColor: 'rgba(54, 162, 235, 0.2)',
        borderColor: 'rgb(54, 162, 235)',
        pointBackgroundColor: 'rgb(54, 162, 235)',
        pointBorderColor: '#fff',
        pointHoverBackgroundColor: '#fff',
        pointHoverBorderColor: 'rgb(54, 162, 235)'
      },
      {
        label: 'Fat',
        data: [],
        fill: true,
        backgroundColor: 'rgba(75, 192, 192, 0.2)',
        borderColor: 'rgb(75, 192, 192)',
        pointBackgroundColor: 'rgb(75, 192, 192)',
        pointBorderColor: '#fff',
        pointHoverBackgroundColor: '#fff',
        pointHoverBorderColor: 'rgb(75, 192, 192)'
      }
    ]
  });

  useEffect(() => {
    const savedNutritionItems = localStorage.getItem('nutritionItems');
    if (savedNutritionItems) {
      const parsedItems = JSON.parse(savedNutritionItems);
      dispatch(updateNutrition(parsedItems));
      console.log(parsedItems)

      // カロリー、タンパク質、脂質を日付ごとに集計
      const totalsByDate: { [key: string]: { calories: number; protein: number; fat: number } } = {};
      parsedItems.forEach((item: any) => {
        if (!totalsByDate[item.date]) {
          totalsByDate[item.date] = { calories: 0, protein: 0, fat: 0 };
        }
        totalsByDate[item.date].calories += item.calories;
        totalsByDate[item.date].protein += item.protein;
        totalsByDate[item.date].fat += item.fat;
      });

      // チャートデータの準備
      const labels = Object.keys(totalsByDate);
      const caloriesData = labels.map(date => totalsByDate[date].calories);
      const proteinData = labels.map(date => totalsByDate[date].protein);
      const fatData = labels.map(date => totalsByDate[date].fat);

      setData({
        labels,
        datasets: [
          {
            label: 'Calories',
            data: caloriesData,
            fill: true,
            backgroundColor: 'rgba(255, 99, 132, 0.2)',
            borderColor: 'rgb(255, 99, 132)',
            pointBackgroundColor: 'rgb(255, 99, 132)',
            pointBorderColor: '#fff',
            pointHoverBackgroundColor: '#fff',
            pointHoverBorderColor: 'rgb(255, 99, 132)'
          },
          {
            label: 'Protein',
            data: proteinData,
            fill: true,
            backgroundColor: 'rgba(54, 162, 235, 0.2)',
            borderColor: 'rgb(54, 162, 235)',
            pointBackgroundColor: 'rgb(54, 162, 235)',
            pointBorderColor: '#fff',
            pointHoverBackgroundColor: '#fff',
            pointHoverBorderColor: 'rgb(54, 162, 235)'
          },
          {
            label: 'Fat',
            data: fatData,
            fill: true,
            backgroundColor: 'rgba(75, 192, 192, 0.2)',
            borderColor: 'rgb(75, 192, 192)',
            pointBackgroundColor: 'rgb(75, 192, 192)',
            pointBorderColor: '#fff',
            pointHoverBackgroundColor: '#fff',
            pointHoverBorderColor: 'rgb(75, 192, 192)'
          }
        ]
      });
    }
  }, [dispatch]);

  const options = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top' as const
      },
      title: {
        display: true,
        text: 'Nutrition Data Visualization'
      }
    }
  };

  return (
    <MainLayout>
      <div>
        <h1>Dashboard Page</h1>
        <p>Welcome to the dashboard.</p>
        <div className='date-div'>
          <label className='label'>日付：</label>
          <input id='date' className='select-kind' type="date" />
        </div>
        <div className='radar-chart'>
          <Radar data={data} options={options} />
        </div>
        <div className='line-chart'>
          <Line data={data} options={options} />
        </div>
        <div className='bar-chart'>
          <Bar data={data} options={options} />
        </div>
      </div>
    </MainLayout>
  );
};

export default Dashboard;
